sys_variable_value.value:
(function execute(inputs, outputs) {
    // ... code ..
    var responsestring = 'Didnt receive valid response. Please try again.';
    try {
        var responseText = inputs.responsetext;
        responsestring = responseText;
        var responseObj = global.JSON.parse(responseText);
        var responseArray = [];
        responseArray = responseObj.results;
        responsestring = 'responseArray' + responseArray;

        var responseElementJson;
        if (global.JSUtil.notNil(responseArray)) {
            responseElementJson = responseArray[0];
            responsestring = 'responseElementJson' + responseElementJson.toString() + ' ' + typeof(responseElementJson) + ' length' + responseArray.length;
            var str = JSON.stringify(responseElementJson);
            //var responseElement = global.JSON.parse(responseElementJson);

            responsestring = 'str' + str;
            var obj = JSON.parse(str);
            if (global.JSUtil.notNil(obj)) {
                var genText = obj.generated_text;
                responsestring = 'genText' + genText;
                if (global.JSUtil.notNil(genText)) {
                    responsestring = genText.toString();
                }
            }
        }
    } catch (e) {
        responsestring = 'exception in GEN AI response parser';
        gs.error('exception in GEN AI response parser' + e);
    }
    outputs.responsestring = responsestring;
})(inputs, outputs);

